let h17: int; Notice the int (integer) primitive type that annotates each variable. Par values have to be integers! A better way and more concise way of rewriting the above is using an array of 18 int values as follows: let h: int[18]; The type int[18] describes an array of 18 integers.

12.body:
Par Values Constraints The first constraint that the design problem imposes is that each hole is assigned a par value of 3, 4, or 5. There are two ways to model this in Yurt. We can use the comparison operators to indicate that each par is greater or equal (>=) to 3 and (&&) less than or equal (<=) to 5: constraint h[0] >= 3 && h[0] <= 5;
constraint h[1] >= 3 && h[1] <= 5;
.
.
constraint h[17] >= 3 && h[17] <= 5; Notice the use of the array element access syntax using [..]. In Yurt, h[i] is the i+1th element in array h. Alternatively, we can constraint each element in h using in and a range expression as follows: constraint h[0] in 3..5;
constraint h[1] in 3..5;
.
.
constraint h[17] in 3..5; The expression h[i] in 3..5 means: h[i] belongs to the set of integers between 3 and 5 inclusive. If h was an array of real values instead, then the range 3..5 would refer to the set of real numbers between 3 and 5 inclusive. Total Par Constraint The problem definition imposes another requirement: the total par of the golf course should be 72. The way to represent this constraint is using a summation as follows: constraint h[0] + h[1] + h[2] + h[3] + h[4] + h[5] + h[6] + h[7] + h[8] + h[9] + h[10] + h[11] + h[12] + h[13] + h[14] + h[15] + h[16] + h[17] == 72

