To finish our program, we need a solve directive and an (optional) print directive. Because we do not have an objective function to optimize for, we can simply use a solve satisfy directive. Note: some modeling problems require optimizing (i.e. maximizing or minimizing) some objective function. Modeling these problems in Yurt require using the directives solve maximize <expr>; or solve minimize <expr>; where <expr> is any valid Yurt expression. The goal of an optimization problem is to find the best solution satisfying the constraints instead of any solution. Our final program now looks like this: let h: int[18]; constraint h[0] in 3..5;
constraint h[1] in 3..5;
constraint h[2] in 3..5;
constraint h[3] in 3..5;
constraint h[4] in 3..5;
constraint h[5] in 3..5;
constraint h[6] in 3..5;
constraint h[7] in 3..5;
constraint h[8] in 3..5;
constraint h[9] in 3..5;
constraint h[10] in 3..5;
constraint h[11] in 3..5;
constraint h[12] in 3..5;
constraint h[13] in 3..5;
constraint h[14] in 3..5;
constraint h[15] in 3..5;
constraint h[16] in 3..5;
constraint h[17] in 3..5; constraint h[0] + h[1] + h[2] + h[3] + h[4] + h[5] + h[6] + h[7] + h[8] + h[9] + h[10] + h[11] + h[12] + h[13] + h[14] + h[15] + h[16] + h[17] == 72 solve satisfy; print h; Open the main.yrt file you created earlier and paste the code above. Save the file, go back to your terminal window in the ~/projects/golf/ directory, and enter the following command to compile and solve the program: $ yurtc --solve main.rs The following should be printed to the terminal: [3, 3, 3, 3, 3, 3, 3, 3, 3, 5, 5, 5, 5, 5, 5, 5, 5, 5]; The values you see may differ from the above, but any values you see should satisfy have the two properties: Each value is an integer between 3 and 5 inclusive. The sum of all the values is exactly 72.
